<!DOCTYPE html>
<html lang="en">
  <head>
    <title>ACME Templates</title>
  </head>
  <style>
    * {
      box-sizing: border-box;
    }
    
    body {
      margin: 0;
      font-family: monospace;
    }
    
    a {
      display: block;
      color: #313149;
      text-decoration: none;
      text-align: center;
    }
    
    a:hover,
    a:focus {
      color: #cf3149;
      text-decoration: underline;
    }
    
    ul {
      list-style: none;
      margin: 0;
      padding: 0;
      display: flex;
      align-content: center;
    }
    
    li {
      border-right: 1px solid #b6b4b6;
      flex-basis: 20%;
      height: 100vh;
      transition: all 0.5s;
      display: flex;
      align-content: center;
      align-items: center;
    }
    
    li:hover {
      flex-basis: 35%;
    }
    
    .template {
      padding: 12px;
      width: 100%;
      background: #f1f3f4;
    }
    
    .template__label {
      display: block;
      padding: 0 0 12px;
    }
    
    .template__image {
      display: block;
      width: 100%;
      height: 0;
      padding-bottom: 175%;
      overflow: hidden;
    }
    
    img {
      width: 100%;
      height: auto;
    }
    
  </style>
